      hdpi = op.inValueBool("Hires Displays", false),
      inUnit = op.inSwitch("Pixel Unit", ["Display", "CSS"], "Display");

    op.onAnimFrame = render;
    hdpi.onChange = function () {
      if (hdpi.get()) op.patch.cgl.pixelDensity = window.devicePixelRatio;
      else op.patch.cgl.pixelDensity = 1;

      op.patch.cgl.updateSize();
      if (CABLES.UI) gui.setLayout();
    };

    active.onChange = function () {
      op.patch.removeOnAnimFrame(op);

      if (active.get()) {
        op.setUiAttrib({ extendTitle: "" });
        op.onAnimFrame = render;
        op.patch.addOnAnimFrame(op);
        op.log("adding again!");
      } else {
        op.setUiAttrib({ extendTitle: "Inactive" });
      }
    };

    const cgl = op.patch.cgl;
    let rframes = 0;
    let rframeStart = 0;
    let timeOutTest = null;
    let addedListener = false;

    if (!op.patch.cgl) op.uiAttr({ error: "No webgl cgl context" });

    const identTranslate = vec3.create();
    vec3.set(identTranslate, 0, 0, 0);
    const identTranslateView = vec3.create();
    vec3.set(identTranslateView, 0, 0, -2);

    fullscreen.onChange = updateFullscreenButton;
    setTimeout(updateFullscreenButton, 100);
    let fsElement = null;

    let winhasFocus = true;
    let winVisible = true;

    window.addEventListener("blur", () => {
      winhasFocus = false;
    });
    window.addEventListener("focus", () => {
      winhasFocus = true;
    });
    document.addEventListener("visibilitychange", () => {
      winVisible = !document.hidden;
    });
    testMultiMainloop();

    op.patch.tempData.mainloopOp = this;

    inUnit.onChange = () => {
      width.set(0);
      height.set(0);
    };

    function getFpsLimit() {
      if (reduceLoadingFPS.get() && op.patch.loading.getProgress() < 1.0)
        return 5;

      if (reduceFocusFPS.get()) {
        if (!winVisible) return 10;
        if (!winhasFocus) return 30;
      }

      return fpsLimit.get();
    }

