Ops.Patch.PLTY302.VectorJoin = class extends CABLES.Op {
  constructor() {
    super(...arguments);
    const op = this;
    const attachments = (op.attachments = {});
    const inX = op.inValueFloat("X"),
      inY = op.inValueFloat("Y"),
      inZ = op.inValueFloat("Z"),
      XYZArray = op.outArray("Output");

    const arr = [];

    inX.onChange = inY.onChange = inZ.onChange = update;

    update();

    function update() {
      if (!arr) {
        return;
      }

      if (arr) {
        arr[0] = inX.get();
        arr[1] = inY.get();
        arr[2] = inZ.get();
      }
      XYZArray.set(null);

      XYZArray.set(arr);
    }
  }
};

